You can write async fn in traits and trait impls. For example: trait Service { async fn request(&self, key: i32) -> Response;
} struct MyService { db: Database
} impl Service for MyService { async fn request(&self, key: i32) -> Response { Response { contents: self.db.query(key).await.to_string() } }
} This is useful for writing generic async code. Currently, if you use an async fn in a trait, that trait is not dyn safe. If you need to use dynamic dispatch combined with async functions, you can use the async-trait crate. We expect to extend the language to support this use case in the future. Note that if a function in a trait is written as an async fn, it must also be written as an async fn in your implementation of that trait. With the above trait, you could not write this: impl Service for MyService { fn request(&self, key: i32) -> impl Future<Output = Response> { async { ... } }
} Doing so will give you an "expected async fn" error. If you need to do this for some reason, you can use an associated type in the trait: trait Service { type RequestFut<'a>: Future<Output = Response> where Self: 'a; fn request(&self, key: i32) -> RequestFut;
} impl Service for MyService { type RequestFut<'a> = impl Future + 'a where Self: 'a; fn request<'a>(&'a self, key: i32) -> RequestFut<'a> { async { ... } }
} Note that in the impl we are setting the value of the associated type to impl Future, because async blocks produce unnameable opaque types. The associated type is also generic over a lifetime 'a, which allows it to capture the &'a self reference passed by the caller.

