Async functions in a trait desugar to an associated function that returns a generic associated type (GAT): Just as with ordinary async functions , the GAT has a generic parameter for every generic parameter that appears on the fn, along with implicit lifetime parameters. The GAT has the complete set of where clauses that appear on the fn, including any implied bounds. The GAT is "anonymous", meaning that its name is an internal symbol that cannot be referred to directly. (In the examples, we will use $ to represent this name.) trait Example { async fn method<P0..Pn>(&self) where WC0..WCn;
} // Becomes: trait Example { type $<'me, P0..Pn>: Future<Output = ()> where WC0..WCn, // Explicit where clauses Self: 'me; // Implied bound from `&self` parameter fn method(&self) -> Self::$<'_> where WC0..WCn;
} async fn that appear in impls are desugared in the same general way as an existing async function , but with some slight differences: The value of the associated type $ is equal to an impl Future type, rather than the impl Future being the return type of the function The function returns a reference to Self::$<...> with all the appropriate generic parameters Otherwise, the desugaring is the same. The body of the function becomes an async move { ... } block that both (a) captures all parameters and (b) contains the body expression. impl Example for ExampleType { async fn method(&self) { ... }
