When you run async drop glue, there is an implicit await point. Consider this example: async fn foo(dbc: DatabaseConnection) -> io::Result<()> { let data = socket().read().await?; dbc.write(data).await?;
} Here, presuming that DatabaseConnection implements AsyncDrop, there are actually a number of async drops occurring: async fn foo(dbc: DatabaseConnection) -> io::Result<()> { let data = match socket().read().await { Ok(v) => v, Err(e) => { std::mem::async_drop(dbc).await; return e; } }; let () = match dbc.write(data).await? { Ok(()) => (), Err(e) => { std::mem::async_drop(dbc).await; return e; } }; std::mem::async_drop(dbc).await;
} As this example shows, there are important ergonomic benefits here to implicit async drop, and it also ensures that async and sync code work in analogous ways. However, implicit await points can be a hazard for some applications, where it is important to identify all await points explicitly (for example, authors of embedded applications use await points to reason about what values will be stored in the resulting future vs the stack of the poll function). To further complicate things, async-drop doesn't only execute at the end of a block or an "abrupt" expression like ?: async-drop can also execute at the end of every statement, given temporary values. The best solution here is unclear. We could have an "allow-by-default" lint encouraging explicit use of async_drop, but as the code above shows, the result may be highly unergonomic (also, imagine how it looks as the number of variables requiring async-drop grows). Another option is to target the problem from another angle, for example by adding lints to identify when large values are stored in a future or on the stack, or to allow developers to tag local variables that they expect to be stored on the stack, and have the compiler warn them if this turns out to not be true. Users could then choose how to resolve the problem (for example, by shortening the lifetime of the value so that it is not live across an await). Running destructors concurrently It's often the case that at the end of a function or scope, multiple destructors are run. In general the order (which is the reverse order of initialization) matters, since one local could borrow from another, or there is some other logical dependency between them. However, in some cases the order might not matter at all. In async, it would be possible to run destructors for multiple locals concurrently. As an example, we could mark the destructors like this: #[concurrent]
impl AsyncDrop for Foo { async fn drop(&mut self) { ... }
} Here, #[concurrent] means that Foo does not take logical dependencies or dependents with other values, and it is safe to drop concurrently. (The compiler would still enforce memory safety, of course.) In these cases, however, it's usually enough to impl synchronous Drop and spawn a task for the "real" destructor. That keeps the language simple, though it's less convenient to write.

