} impl Trait for TypeA { async fn foo(&self);
} impl Trait for TypeB { ... } Consider the desugared form of this trait: trait Trait { type Foo<'s>: Future<Output = ()> + 's; fn foo(&self) -> Self::Foo<'_>;
